import React from "react";
import { Link } from "react-navi";
import './Header.css';

const Navigation = () => {

return <div className="navbar">
    <Link className="button" href="join-meeting">Join meeting</Link>
    <Link className="button"  href="create-meeting">Create meeting</Link>
    <Link className="button"  href="home">About us</Link>
</div>

}

export default Navigation;
